import React from "react";

const User = (props) => {
  return (
    <div style={{ width: "100%", margin: "0 auto", textAlign: "center" }}>
      <h2>
        I'm {props.name} and I am {props.age} years old!
      </h2>
      <h3>{props.children}</h3>
    </div>
  );
};

export default User;
